import "./topbar.css";

export default function TopBar() {
  return (
    <div className="top">
      <div className="topright">
        <i className="notification far fa-bell"></i>
        <img className="cover-image" src="https://images.unsplash.com/photo-1438761681033-6461ffad8d80?ixid=MnwxMjA3fDB8MHxzZWFyY2h8MXx8cGVyc29ufGVufDB8fDB8fA%3D%3D&ixlib=rb-1.2.1&w=1000&q=80" alt="" />
      </div>
    </div>
  );
}
